import React from 'react';
import {ScrollView, StatusBar, StyleSheet, Button} from 'react-native';

import Suspeito from'./pages/Suspeito.js';
import Locais from'./pages/Locais.js';
import {Armas, redefinir} from'./pages/Armas.js';


export default function App() {
  return (
    <ScrollView style={styled.main}>
      <StatusBar hidden/>
      <Suspeito/>
      <Armas/>
      <Locais/>
      <Button onPress={()=>redefinir} title='Limpar'/>
    </ScrollView>
  )
}

const styled = StyleSheet.create({
  main:{
    backgroundColor: 'black'
  }
}
);
